define(['jquery'], function($) {
    $(function () {
        $('.main-column').append('<div id="container" style="position: relative; width: 560px; height: 180px; margin: 15px auto 0px; overflow: hidden;">' +
            '<div id="list" style="left: -560px; position: absolute; width: 2800px; height: 180px; z-index: 1;">' +
                '<a href="http://musics.renren.com" target="_blank" style="float: left;"><img src="music_001.png" alt="1" style="border: none; display: block;"></a>' +
                '<a href="http://musics.renren.com" target="_blank" style="float: left;"><img src="music_001.png" alt="1" style="border: none; display: block;"></a>' +
                '<a href="http://musics.renren.com" target="_blank" style="float: left;"><img src="music_002.png" alt="2" style="border: none; display: block;"></a>' +
                '<a href="http://musics.renren.com" target="_blank" style="float: left;"><img src="music_003.png" alt="3" style="border: none; display: block;"></a>' +
                '<a href="http://musics.renren.com" target="_blank" style="float: left;"><img src="music_003.png" alt="3" style="border: none; display: block;"></a>' +
            '</div>' +
            '<div id="buttons" style="position: absolute; left: 260px; bottom: 20px; z-index: 2; width: 100px; height: 10px;">' +
                '<span index="1" class="on" style="float: left; width: 10px; height: 10px; margin-right: 5px; border-radius: 50%; background: orangered; border: 1px solid rgb(255, 255, 255); cursor: pointer;"></span>' +
                '<span index="2" style="float: left; width: 10px; height: 10px; margin-right: 5px; border-radius: 50%; background: rgb(51, 51, 51); border: 1px solid rgb(255, 255, 255); cursor: pointer;"></span>' +
                '<span index="3" style="float: left; width: 10px; height: 10px; margin-right: 5px; border-radius: 50%; background: rgb(51, 51, 51); border: 1px solid rgb(255, 255, 255); cursor: pointer;"></span>' +
            '</div>' +
            '<a href="javascript:;" id="prev" style="left: 20px; position: absolute; top: 70px; z-index: 2; display: none; width: 40px; height: 40px; font-size: 20px; line-height: 36px; text-align: center; text-decoration: none; color: rgb(255, 255, 255); border-radius: 50%; background-color: #000; background-color: rgba(0, 0, 0, 0.3); cursor: pointer;" class="arrow">&lt;</a>' +
            '<a href="javascript:;" id="next" style="right: 20px; position: absolute; top: 70px; z-index: 2; display: none; width: 40px; height: 40px; font-size: 20px; line-height: 36px; text-align: center; text-decoration: none; color: rgb(255, 255, 255); border-radius: 50%; background-color: #000; background-color: rgba(0, 0, 0, 0.3); cursor: pointer;" class="arrow">&gt;</a>' +
        '</div>')

        var buttons = $('#buttons').find('span');
        var container = $('#container');
        var list = $('#list');
        var prev = $('#prev');
        var next = $('#next');
        var index = 1;
        var len = 3;
        var interval = 3000;
        var imgWidth = 560;
        var timer;

        function animate (offset) {
            var left = parseInt(list.css('left')) + offset;
            if (offset>0) {
                offset = '+=' + offset;
            }
            else {
                offset = '-=' + Math.abs(offset);
            }
            list.animate({'left': offset}, 300, function () {
                if(left > -200){
                    list.css('left', -imgWidth * len);
                }
                if(left < (-imgWidth * len)) {
                    list.css('left', -imgWidth);
                }
            });
        }

        function showButton() {
            buttons.eq(index-1).addClass('on').css({ background: 'orangered' }).siblings().removeClass('on').css({ background: '#333' });
        }

        function play() {
            timer = setTimeout(function () {
                next.trigger('click');
                play();
            }, interval);
        }
        function stop() {
            clearTimeout(timer);
        }

        next.bind('click', function () {
            if (list.is(':animated')) {
                return;
            }
            if (index == 3) {
                index = 1;
            }
            else {
                index += 1;
            }
            animate(-imgWidth);
            showButton();
        });

        prev.bind('click', function () {
            if (list.is(':animated')) {
                return;
            }
            if (index == 1) {
                index = 3;
            }
            else {
                index -= 1;
            }
            animate(imgWidth);
            showButton();
        });

        buttons.each(function () {
                $(this).bind('click', function () {
                    if (list.is(':animated') || $(this).attr('class')=='on') {
                        return;
                    }
                    var myIndex = parseInt($(this).attr('index'));
                    var offset = -imgWidth * (myIndex - index);

                    animate(offset);
                    index = myIndex;
                    showButton();
                })
        });

//         container.hover(stop, play);
        container.hover(function () {
            $('.arrow').css({ 'display': 'block' });
            stop();
        }, function () {
            $('.arrow').css({ 'display': 'none' });
            play();
        });

        $('.arrow').hover(function(){
            $(this).css({ 'background': '#000', 'background-color': 'rgba(0,0,0,.7)' });
        }, function () {
            $(this).css({ 'background': '#000',  'background-color': 'rgba(0,0,0,.3)' });
        });

        play();

    })
})
